import React from 'react';
import classes from './Profile.module.css';


const Profile = () => {
  return (
    <div className={classes.content}>
      <div className='hello'>
        <img className='profile_img' src='https://filedn.com/ltOdFv1aqz1YIFhf4gTY8D7/ingus-info/BLOGS/Photography-stocks3/stock-photography-slider.jpg' alt='imgHolder' />
      </div>
      <div>
        Ava + description
        </div>
      <div>
        My posts
        </div>

      <div>New post</div>
      <div>Post 1</div>
      <div>Post 2</div>

    </div>
  );
}

export default Profile;
